        vector<string> in(m), out(m);
        for (int i = 0; i < m; ++i)
            cin >> ds[i] >> in[i] >> out[i];

        int ans = dijkstra(in, out, ds, (int) getset(start).to_ullong(), 0);
        cout << ans << endl;
    }
    return 0;
};

