#include <iostream>
#include <string>

using namespace std;

inline int getID(char c) {
    return ('a' <= c && c <= 'z') ? c-'a' : c-'A'+26;
}

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0); cout.tie(0);
    int m, n; cin >> m >> n;
    string t, s; cin >> t >> s;
    int targetF[52]{}, f[52]{};
    for (char c : t) ++targetF[getID(c)];
    for (int i = 0; i < m-1; ++i) ++f[getID(s[i])];
    int differences = 0;
    for (int i = 0; i < 52; ++i) differences += targetF[i] != f[i];

    int total = 0;
    for (int i = m-1; i < n; ++i) {
        // add
        int c = getID(s[i]);
        ++f[c];
        if (f[c] == targetF[c]) --differences;
        else if (f[c] == targetF[c]+1) ++differences;

        // check
        if (!differences) ++total;

        // remove
        c = getID(s[i-m+1]);
        --f[c];
        if (f[c] == targetF[c]) --differences;
        else if (f[c] == targetF[c]-1) ++differences;
    }
    cout << total << endl;
    return 0;
}

function areEqual(r1, r2) {
  // Func for checking equality of two ranges
  return r1.getDataSourceUrl() === r2.getDataSourceUrl()
}

function onEdit(e) {
  if (e.value == undefined) {
    // If event is not EDITING an value of cell then exit
    return;
  }
  // Initial range
  const range = e.range;
  // Current sheet for working
  const ss = range.getSheet();
  // Total amount of all columns
  const MAXCOLUMNS = ss.getMaxColumns();
  // Index of the initial row
  var idx_init_row = range.getRow();

  // Initial row
  var initRange = ss.getRange(idx_init_row, 1, 1, MAXCOLUMNS);
  // Copy of values from the initial row
  const values = initRange.getValues();
  // Cell of first row for column of initial range
  var top_cell_range = ss.getRange(1, range.getColumn());
  if (!areEqual(range, top_cell_range)) {
    // Delete the initial row
    ss.deleteRow(idx_init_row);
  
    // Insert row before first row;
    ss.insertRowBefore(1);
    // First row
    var targetRange = ss.getRange(1, 1, 1, MAXCOLUMNS);
    // Setting values for the first row
    targetRange.setValues(values);
  }
}

#include <iostream>
#include <vector>
#include <queue>

using namespace std;

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0); cout.tie(0);
    int n, m; cin >> n >> m;
    vector<int> r(1+n), w(1+m);
    for (int i = 1; i <= n; ++i) cin >> r[i];
    for (int j = 1; j <= m; ++j) cin >> w[j];
    queue<int> queue;
    vector<int> car(1+n);
    int freeSpaces = n, revenue = 0;
    for (int t = 0; t < 2*m; ++t) {
        int v; cin >> v;
        int j = abs(v);
        if (v > 0) queue.push(j);
        else {
            ++freeSpaces;
            for (int i = 1; i <= n; ++i) {
                if (car[i] == j) {
                    car[i] = 0;
                    break;
                }
            }
        }
        // clear queue
        for (int i = 1; i <= n && freeSpaces && !queue.empty(); ++i) {
            if (!car[i]) {
                --freeSpaces;
                car[i] = queue.front();
                queue.pop();
                revenue += r[i] * w[car[i]];
            }
        }
    }
    cout << revenue << endl;
    return 0;
}

#include <iostream>
#include <vector>

using namespace std;

const int INF = 1e9;

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0); cout.tie(0);
    int n, m; cin >> n >> m;
    vector<vector<int>> a(1+n, vector<int>(1+m));
    for (int i = 1; i <= n; ++i) {
        for (int j = 1; j <= m; ++j) cin >> a[i][j];
    }
    vector<vector<int>> pre = a;
    for (int i = 1; i <= n; ++i) {
        for (int j = 1; j <= m; ++j) pre[i][j] += pre[i][j-1];
        for (int j = 1; j <= m; ++j) pre[i][j] += pre[i-1][j];
    }
    auto rangeSum = [&](int top, int bottom, int left, int right) {
        --top, --left;
        return pre[bottom][right] - pre[bottom][left] - pre[top][right] + pre[top][left];
    };

    // dp with O((nm)^2) states, and O(n+m) transitions for each state
    vector<vector<vector<vector<int>>>> minCost(1+n, vector<vector<vector<int>>>(1+n, vector<vector<int>>(1+m, vector<int>(1+m, INF))));
    // in order of increasing size
    for (int height = 1; height <= n; ++height) {
        for (int width = 1; width <= m; ++width) {
            for (int top = 1, bottom = height; bottom <= n; ++top, ++bottom) {
                for (int left = 1, right = width; right <= m; ++left, ++right) {
                    // find minCost[top][bottom][left][right]
                    int cutCost = rangeSum(top, bottom, left, right);
                    int &cur = minCost[top][bottom][left][right];
                    if (height == 1 && width == 1) {
                        cur = 0;
                        continue;
                    }
                    
                    // try a horizontal cut
                    for (int middle = top+1; middle <= bottom; ++middle) {
                        int x = minCost[top][middle-1][left][right];
                        int y = minCost[middle][bottom][left][right];
                        cur = min(cur, cutCost + x + y);
                    }

                    // try a vertical cut
                    for (int middle = left+1; middle <= right; ++middle) {
                        int x = minCost[top][bottom][left][middle-1];
                        int y = minCost[top][bottom][middle][right];
                        cur = min(cur, cutCost + x + y);
                    }
                }
            }
        }
    }
    cout << minCost[1][n][1][m] << endl;
    return 0;
}

#include <iostream>
#include <vector>
#include <tuple>
#include <algorithm>

using namespace std;

int main() {
    ios_base::sync_with_stdio(0); cin.tie(0); cout.tie(0);
    int n, t, p; cin >> n >> t >> p;
    --p;
    vector<vector<bool>> solved(n, vector<bool>(t));
    vector<int> solveCount(n), difficulty(t);
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < t; ++j) {
            int x; cin >> x; solved[i][j] = x;
            if (solved[i][j]) ++solveCount[i];
            else ++difficulty[j];
        }
    }
    vector<int> score(n);
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < t; ++j) {
            if (solved[i][j]) score[i] += difficulty[j];
        }
    }
    vector<tuple<int, int, int>> v(n);
    for (int i = 0; i < n; ++i) v[i] = {score[i], solveCount[i], -i};
    sort(v.rbegin(), v.rend());
    for (int i = 0; i < n; ++i) {
        if (get<2>(v[i]) == -p) cout << get<0>(v[i]) << ' ' << i+1 << endl;
    }
    return 0;
}

